INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (1, 1, 0, 0.5, 31114071, 0, 103111, 10, "本日は、私の誕生日を祝っていただいて\nありがとうございます……\n豪華なケーキまで用意していただいて、\n何かお返しを考えないといけませんね。", 11, 31114);
INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES ("", "", "", "", 31114072, "", 0, "", "", 91, 31114);
